tables.table_schema:
CREATE TABLE survey_responses (
    response_id INT PRIMARY KEY,
    survey_id INT,
    respondent_id INT,
    response_text TEXT
);

CREATE TABLE feedback_data (
    feedback_id INT PRIMARY KEY,
    respondent_id INT,
    feedback_text TEXT,
    rating INT
);

CREATE TABLE SurveyFeedback (
  feedback_id INT PRIMARY KEY,
  response_id INT,
  feedback_text TEXT,
  feedback_date TIMESTAMP
);

CREATE TABLE respondents (
    id INT PRIMARY KEY,
    name TEXT,
    email TEXT
);

CREATE TABLE surveys (
    id INT PRIMARY KEY,
    survey_name TEXT,
    created_at TIMESTAMP
);

CREATE TABLE questions (
    id INT PRIMARY KEY,
    question_text TEXT,
    question_type TEXT
);

CREATE TABLE feedback (
    id INT PRIMARY KEY,
    respondent_id INT,
    feedback_text TEXT,
    created_at TIMESTAMP
);
